import {Link} from 'react-router-dom';
import './pages.scss';

function SignInPage() {
  return(
    <div className='sing-page'>
      <p className='sing-page__header'>Sign In</p>
      <span className='sing-page__name-input'>Email address</span>
      <Input className='sing-page__input' placeholder="Email address" />
      <span className='sing-page__name-input'>Password</span>
      <Input className='sing-page__input' placeholder="Password" />
      <Button className='sing-page__button'>Login</Button>
      <p className='sing-page__question'>Donâ€™t have an account? <Link to={'/sing_up'} className='sing-link' href="#">Sign Up</Link>.</p>
    </div>
  )
}

export default SignInPage;
